var bitacoraUrl=global_settings.urlCORS+"api/bitacoraapi/";registrationModule.factory("bitacoraRepository",function(t){return{get:function(){return t.get(bitacoraUrl+"0-0")},getByEmpleado:function(r){return t.get(bitacoraUrl+"1-"+r)},add:function(r,a){return t.post(bitacoraUrl+r+"-"+a)},"delete":function(){return t["delete"](bitacoraUrl)},put:function(r){return t.put(bitacoraUrl,r)}}});